@mixin a-border-right-smallest ( $important:null ) {
 border-right: $border-right-smallest $important; }

drop-shadows.css_string:
.a-shadow-top-right {  box-shadow : 3px -3px 3px 0 rgba( 0,0,0,.1); }
.a-shadow-top-left {  box-shadow : -3px -3px 3px 0 rgba( 0,0,0,.1); }
.a-shadow-top {  box-shadow : 0 -3px 3px 0 rgba( 0,0,0,.1); }
.a-shadow-bottom {  box-shadow : 0 3px 3px 0 rgba( 0,0,0,.1); }
.a-shadow-bottom-right {  box-shadow : 3px 3px 3px 0 rgba( 0,0,0,.1); }
.a-shadow-bottom-left {  box-shadow : -3px 3px 3px 0 rgba( 0,0,0,.1); }
.a-shadow-left {  box-shadow : -3px 0 3px 0 rgba( 0,0,0,.1); }
.a-shadow-right {  box-shadow : 3px 0 3px 0 rgba( 0,0,0,.1); }

drop-shadows.mixins_string:
@mixin a-shadow-top-right ( $important:null ) {
 box-shadow : 3px -3px 3px 0 rgba( 0,0,0,.1) $important; }
@mixin a-shadow-top-left ( $important:null ) {
 box-shadow : -3px -3px 3px 0 rgba( 0,0,0,.1) $important; }
@mixin a-shadow-top ( $important:null ) {
 box-shadow : 0 -3px 3px 0 rgba( 0,0,0,.1) $important; }
@mixin a-shadow-bottom ( $important:null ) {
 box-shadow : 0 3px 3px 0 rgba( 0,0,0,.1) $important; }
@mixin a-shadow-bottom-right ( $important:null ) {
 box-shadow : 3px 3px 3px 0 rgba( 0,0,0,.1) $important; }
@mixin a-shadow-bottom-left ( $important:null ) {
 box-shadow : -3px 3px 3px 0 rgba( 0,0,0,.1) $important; }
@mixin a-shadow-left ( $important:null ) {
 box-shadow : -3px 0 3px 0 rgba( 0,0,0,.1) $important; }
@mixin a-shadow-right ( $important:null ) {
 box-shadow : 3px 0 3px 0 rgba( 0,0,0,.1) $important; }
